create table employee (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	salary INT,
	dept_id INT
);
SELECT * FROM employee
select top 1 * from (
	select top 2 * 
	from employee
	order by salary desc
) as t1
order by salary asc

select top 10 * 
from employee
order by salary desc

update employee
set salary= 9982
where id = 346

select * from employee where salary = (
select top 1 salary from (
	select distinct top 2 * 
	from employee
	order by salary desc
) as t1
order by salary asc
)
declare @n int = 2
select * from (
	select *, DENSE_RANK() over(partition by dept_id order by salary desc) rnk
	from employee
) t
where rnk = @n

with cte 
as (
	select 1 as n
	union all
	select n+1 from cte
	where n <50
)
select n from cte



