declare @word varchar(50) = 'Hello World'

;with cte 
as (
	select 1 as n, SUBSTRING(@word, 1,1) as chars
	union all
	select n+1, SUBSTRING(@word,n+1,1)
	from cte
	where n < len(@word)
)
select * from cte


